2	Путешествие во время беременности: на что обратить внимание	2023-05-07 13:00:00	Большинство врачей сходится во мнении, что во время беременности главное – позитивный настрой. А что ещё так помогает зарядиться энергией, положительными эмоциями и набраться сил, как не путешествия? Так что, если у вас нет медицинских противопоказаний и необходимости соблюдать особый режим, путешествуйте на здоровье! Вам придётся лишь немного скорректировать привычный сценарий отпуска и учесть пару нюансов, чтобы сделать свою поездку в этот период комфортной и приятной.\r\n1. Выбор направления\r\nБеременность, конечно, не болезнь, а беременная – не инвалид, но всё-таки нельзя отрицать, что это особое состояние для организма. В первую очередь позаботьтесь о том, чтобы медицинская помощь была легко доступна во время вашего путешествия; просто на всякий случай. Поездки в экзотические страны с низким уровнем медицинских услуг лучше пока отложить. Кстати, качество системы здравоохранения не всегда напрямую соответствует уровню жизни в стране, например, в Таиланде, на Кубе и в Мексике медицина на высоте. Очень важно избегать во время беременности поездок в регионы с неблагоприятной эпидемиологической обстановкой, например, с высоким риском заражения малярией или вирусом Зика. Актуальную информацию на эту тему можно найти на сайте ВОЗ.\r\nНе забывайте, что дешевле и проще планировать поездку, воспользовавшись нашим пакетом «перелёт+отель»\r\n2. Медицинская страховка\r\nУчтите, что стандартные туристические полисы не покрывают случаев, связанных с беременностью, так что вам придётся купить специальную расширенную медицинскую страховку. Это довольно дорогая услуга и предоставляют её не все компании на российском рынке, но экономить на ней точно не стоит. Застраховаться можно лишь до наступления определённого срока беременности, у большинства компаний это 24-30 недель, но некоторые страхуют и до 36.\r\n3. Способ передвижения\r\nРоссийские врачи любят пугать беременных опасностями авиаперелётов, хотя на деле самолёт опасен только тем, что на борту нельзя в любой момент получить медпомощь. Некоторые неприятности может доставить обезвоживание, с которым вы наверняка столкнётесь из-за пересушенного воздуха в салоне. Но с этим справиться легко – просто пейте больше воды. Заодно это поможет избежать отёков и снизить риск тромбоза. Самую большую опасность во время полёта представляет длительное нахождение в одной позе, из-за этого как раз и повышается вероятность тромбоза глубоких вен. Для предотвращения такого состояния рекомендуется побольше двигаться, гулять по салону и выполнять простые упражнения. Не забудьте также про компрессионное бельё, есть мнение, что оно показано на время перелёта всем беременным как страховочная мера. Многие беременные отказываются от авиапутешествий из-за радиации. Действительно, на высоте перемещения самолёта интенсивность гамма-излучения немного возрастает, но при единичных перелётах суммарная доза незначительна (чтобы достигнуть допустимого предела нужно налетать 300-400 часов).\r\nЕсли вы всё же опасаетесь летать, на выбор остаются автомобиль и поезд. Основное правило для путешествующих автомобилем – всегда пристёгивайтесь. Даже если у вас нет специального ремня для беременных, лучше воспользоваться штатным, чем ехать вообще не пристёгнутой. Ни в коем случае не отключайте подушки безопасности в машине – риск их отсутствия в разы превышает потенциальные неприятности от срабатывания. Каждые два-три часа обязательно останавливайтесь, чтобы размяться. На время путешествия запаситесь водой, едой и средствами от укачивания. Даже если раньше вас никогда не тошнило в машине, во время беременности это может произойти.\r\nЧто касается поезда, единственный его недостаток по сравнению с самолётом – маленькая скорость, а в остальном это идеальный транспорт для беременных.\r\n4. Срок беременности\r\nЛучшее время для путешествий – второй и начало третьего триместра, токсикоз к этому времени обычно уже проходит, но вы ещё не слишком быстро устаёте. К тому же по правилам некоторых авиакомпаний летать на сроке больше 24-36 недель запрещено. Если ваша беременность уже заметна, представитель авиакомпании имеет право потребовать справку от врача, прежде чем пустить вас на борт. В справке должен быть указан срок в неделях и информация, что беременность протекает без осложнений и для перелёта нет противопоказаний. Если вы летите иностранной компанией, особенно если аэропорты вылета и прилёта находятся не в России, сделайте нотариальный перевод справки на английский; документ на русском у вас могут не принять. Такие бумаги выдают как в государственных женских консультациях, так и в коммерческих клиниках.\r\n5. Несколько простых правил\r\nСамое главное – не переутомляться. Если у вас достаточно сил, чтобы гулять пешком несколько часов подряд, не отказывайте себе в прогулках, а если вы быстро устаёте, дайте себе возможность отдохнуть. Ни в коем случае не заставляйте себя ходить по музеям или плавать в море через силу, у вас есть полное право распоряжаться своим отпуском по собственному усмотрению и с учётом своих возможностей.\r\nЭто же правило применимо к активному отдыху – если вам легко даются пробежки и многокилометровые заплывы, нет никакой необходимости себя ограничивать без особых указаний врача. Но если раньше вы не отличались любовью к трекингу или езде на велосипеде, во время беременности начинать их практиковать точно не стоит.\r\nЧто касается еды и питья, самое важное – избегать пищевых отравлений; во время беременности они чреваты неприятными последствиями и для мамы, и для малыша. Так что тщательно мойте все овощи и фрукты бутилированной водой и не питайтесь в сомнительных заведениях. Особенной диеты для беременных не существует, а все указания по питанию в этот период должен давать врач с учётом ваших индивидуальных особенностей. Обычно беременным рекомендуют отказаться от продуктов из непастеризованного молока, сырых мяса и яиц, и некоторых сортов рыбы.\r\nВ этот период очень важно придерживаться правил пребывания на солнце: не находиться под воздействием прямых солнечных лучей с 12 до 16, защищать кожу и голову и регулярно пить воду.\r\nИ помните, окончательное решение о путешествии во время беременности можно принимать только после консультации со своим врачом.	1	t
7	Роковые ошибки в питании и их исправление	2023-05-23 14:00:00	Чтобы жизнь приносила радость, была долгой и счастливой, человек обязан выполнять правила ЗОЖа (здорового образа жизни). Самые главные правила – правильное питание и достаточная физическая нагрузка. Эти два пункта – как два брата близнеца, которые должны быть неразделимы, и оба присутствовать в жизни.\r\n\r\nЭта статья предоставит информацию об ошибках, которые люди часто совершают неосознанно в своем питании. Но эти ошибки способны серьезно на них повлиять. Поэтому очень важно их устранить, после чего качество жизни улучшится.\r\n\r\nОшибка № 1. Съедаем еды больше, чем необходимо организму.\r\n\r\nЭто самая распространенная и самая опасная ошибка для здоровья. Потому что пища, которая не успела в полной мере усвоиться, начинает гнить в кишечнике. Еще эта ошибка быстро приведет к набору лишнего веса. Именно поэтому основы здорового и диетического питания гласят, что есть нужно часто, но при этом порция в тарелке должна быть минимальной.\r\n\r\nДля обработки пищи, которую мы употребляем, организм растрачивает немало энергии. Она расходуется на расщепление пищи на такие составляющие, как микро– и макроэлементы. Поэтому, если съесть пищи больше, чем нужно организму, то и энергии для пищеварения потребуется значительно больше. Отсюда усталость и желание полежать на диване после обеда.\r\n\r\nА ведь организму надо тратить энергию на выполнение и других своих потребностей. Например, такая функция, как очищение, крайне важна для него. При недостаточном ее выполнении это сразу сказывается на самочувствии и проявляется такими симптомами, как несвоевременное опорожнение кишечника, экземы и дерматит на коже.\r\n\r\nОшибка № 2. Употребляем не ту пищу.\r\n\r\nВся вредная пища, которая поступает в организм, способна оставить на нем свои следы. Это может проявиться также дерматитом и плохим самочувствием, или могут образоваться прыщики на лице.\r\n\r\nЕсли постоянно употреблять пищу, в которой много быстрых углеводов, при этом забывать о необходимости физической нагрузки, лишний вес в таком случае обеспечен. А это уже чревато приобретением диабета второго типа, который появляется у людей из-за ожирения.\r\n\r\nОшибка № 3. Пьем мало воды.\r\n\r\nВода – это составная часть человеческого организма. У новорожденного ребенка тело состоит из нее примерно на 85%, а у старых людей – только 50%.\r\n\r\nПоэтому очевидность необходимости воды для человека доказывать не нужно.\r\n\r\nКаждой клетке организма она постоянно необходима, все процессы жизнедеятельности без нее не обойдутся.\r\n\r\nЗа сутки следует воды выпивать примерно два литра. Лучше всего употреблять именно воду, а не чай или вообще сладкие напитки, которые повышают вес.\r\n\r\nЧтобы восстановить гармонию в организме, все эти ошибки нужно исправить.\r\n\r\nРабота над ошибками\r\n\r\nОшибка № 1.\r\n\r\nЕдим часто, но при этом порция в тарелке минимальная.\r\n\r\nЭто главное условие в здоровом питании. Чем быстрее этот факт будет принят как аксиома, тем быстрее будут результаты. Такой способ приема еды можно назвать и питанием для похудения.\r\n\r\nЧтобы легче было подсчитать калории, съеденные с пищей, можно завести дневник, куда записывать весь свой дневной рацион. Это может быть и бумажная тетрадка, и приложение в смартфоне. С помощью этого легко определить, какой продукт является лишним и ненужным.\r\n\r\nЧасто люди заедают скверное настроение всякими лакомствами. И это помогает, но ненадолго, и следующая порция сладкого для поддержания настроения нужна будет уже очень скоро. А всё это чревато набором излишнего веса.\r\n\r\nОшибка № 2.\r\n\r\nВ рационе должна быть только здоровая пища.\r\n\r\nОрганизму человека для нормальной полноценной работы, как и машине – бензин, необходима качественная разнообразная и здоровая еда. Что скрывается под этим понятием? В рационе человека должны присутствовать: белки (мясо или молочное), овощи, зерновые культуры, фрукты. Если есть папайю, бананы, авокадо и яблоки, а больше ничего – то это неразнообразное питание. Исключение составляют люди, которые придерживаются сыроедения. Такой рацион питания тоже имеет право существовать.\r\n\r\nПища должна быть термически обработана в духовке или на пару, в таком случае она сохраняет в себе все необходимые витамины.\r\n\r\nРацион обязательно должен быть наполнен клетчаткой (овощи, фрукты), это необходимо для перистальтики кишечника.\r\n\r\nОшибка № 3.\r\n\r\nНеобходимо пить достаточно воды.\r\n\r\nЗа сутки следует воды выпивать примерно два литра. Следует употреблять именно воду, потому что если выпить чай, сок или кофе, то организму придется постараться, чтобы превратить их все-таки в воду.\r\n\r\nЕсли устранить эти ошибки из рациона питания, можно сразу почувствовать себя лучше. А если есть лишний вес – то это уже ненадолго. Потому что сочетание полезного питания с физическими упражнениями – залог хорошей фигуры и здоровья.	1	t
8	Как определить самые полезные источники углеводов?	2023-05-28 15:00:00	Какие источники углеводов считаются полезными?\r\nМногочисленные исследования подтверждают, что потребление овощей и фруктов снижает риск опасных заболеваний, а сахар и сладкие напитки, наоборот, увеличивают шансы скончаться от инфаркта или инсульта и грозят набором лишних килограммов.\r\n\r\nВОЗ даёт чёткие рекомендации: не менее 400 г овощей и фруктов в сутки, не более 10% от общего количества калорий — из сахара.\r\n\r\nНо когда дело доходит до главных источников углеводов в нашем рационе — хлеба, картофеля, круп и макарон — всё становится куда сложнее. А учитывая огромное разнообразие продуктов из этой категории, определить их пользу для здоровья может стать той ещё задачкой.\r\n\r\nКак понять, что из злаковых продуктов лучше\r\nОсновным критерием пользы таких продуктов можно назвать количество клетчатки. Это пищевые волокна, которые не перевариваются в организме, замедляют процесс усвоения углеводистой пищи и подкармливают полезные бактерии в кишечнике.\r\n\r\nСогласно метаанализам научных работ, высокий уровень клетчатки в питании снижает риск ССЗ, диабета 2-го типа, некоторых видов рака и общей смертности.\r\n\r\nС её количеством тесно связано понятие гликемического индекса (ГИ). Это условный коэффициент, который показывает, как быстро повысится уровень глюкозы после приёма пищи. Как правило, чем меньше ГИ продукта, тем больше в нём клетчатки и тем медленнее будет расти сахар в крови после еды.\r\n\r\nПроблема метода состоит в том, что приходится смотреть коэффициент по таблицам, а значения в них общие. Например, если вы выбираете между двумя видами хлеба или макарон в магазине, таблица ГИ не подскажет, какой из них будет лучше.\r\n\r\nЧтобы внести ясность, учёные предложили использовать другой метод — правило 10:1:2. Этот способ помогает быстро определить, полезен ли продукт, ориентируясь на его состав.\r\n\r\nВ чём суть правила 10:1:2\r\nВсё просто: на каждые 10 г углеводов в продукте должно быть не менее 1 г клетчатки и не более 2 г свободного сахара.\r\n\r\nВ научной работе 2020 года бразильские учёные проверили, действительно ли эта метрика связана с более здоровым питанием.\r\n\r\nОказалось, что люди, чей рацион подходил под правило, потребляли меньше углеводов, насыщенных жиров и сахара и при этом получали больше клетчатки, белка, калия, железа, селена, магния и цинка. Более того, уровень триглицеридов и «плохого» холестерина у них был ниже, а чувствительность к инсулину — выше, чем у тех, кто выбирал менее полезные источники.\r\n\r\nВ другом эксперименте 2020 года учёные проверили, подойдёт ли метод 10:1:2 для пищевых продуктов в странах Южной Азии и Австралии.\r\n\r\nОказалось, что еда, соответствующая этому правилу, имела более высокий процент клетчатки, белка, витаминов и минералов, меньше сахара, трансжиров и холестерина по сравнению с продуктами, которые не вписались в границы. То же увидели в ещё одном исследовании с данными более 12 тысяч австралийцев.\r\n\r\nУчёные сделали вывод, что метрика помогает быстро определять качество продуктов и выбирать то, что действительно полезно для здоровья.\r\n\r\nКак вычислить, полезен ли продукт\r\nПользоваться правилом 10:1:2 максимально просто. Нужно только разделить общее количество углеводов (г) на 10, а затем посмотреть, сколько в продукте клетчатки и сахара.\r\n\r\nНапример, в гречневой крупе содержится 63 г углеводов. Делим 63 г на 10 и получаем 6,3 — столько граммов клетчатки должно быть в гречке, чтобы она считалась полезной. По факту же пищевых волокон в ней даже больше — 10 г, а значит, можно записать эту кашу в хороший источник углеводов. Сахара в ней вообще нет, так что этот параметр тоже в порядке.\r\n\r\nТеперь повторим расчёты с макаронами. В 100 г пасты содержится 30 г углеводов и только 1,8 г клетчатки — почти вполовину меньше, чем нужно, чтобы признать продукт полезным. Сахара здесь 0,56 г — меньше, чем разрешённые 6 г, поэтому с этим параметром порядок.\r\n\r\nДля контраста возьмём шоколадный пончик. В нём содержится 31 г углеводов, 1 г клетчатки и 13 г сахара. То есть пищевых волокон в нём в три раза меньше, а сахара — в два раза больше, чем нужно. Можно смело вычёркивать его из списка полезных.\r\n\r\nПопробуйте это правило для оценки своего рациона, но помните, что во всём нужна мера. Даже полезные каши и цельнозерновой хлеб могут прибавить вам лишних килограммов, а свежие овощи и фрукты — вызвать проблемы с пищеварением, если переедать и не учитывать особенности своего организма.	1	t
1	Бег по утрам: как начать?	2023-04-27 12:00:00	Бег по утрам — традиционный атрибут здорового образа жизни и фитнеса. Разберемся, как сделать пробежки максимально комфортными и полезными, а также поговорим о том, как правильно строить пробежку.\r\n\r\nБегать по утрам — универсальный фитнес. Для него нужны только кроссовки, а парк, сквер, лесную тропинку или школьный стадион можно найти везде. Поэтому именно пробежка по утрам приходит на ум тем, кто решает начать здоровый образ жизни. Тем более весной, когда светает все раньше, на улице солнышко, поют птички и распускаются листья, а жары и комаров еще нет.\r\n\r\nНо тут важно учитывать ваши биоритмы. «Жаворонки без проблем встают на час-полтора раньше, а вот совам стоит не переносить подъем, а сдвинуть начало рабочего дня, — говорит Дмитрий Лапкин, фитнес-тренер, спортивный врач, ведущий онлайн-фитнес-проекта Fit&Well. — Если это невозможно, то, вероятно, лучше бегать по вечерам, так как недосып по утрам сведет на нет все плюсы утреннего бега». Тренировка должна проходить в то время, которое подходит вашему жизненному ритму, иначе вы не успеете восстановиться.\r\n\r\nКак бегать по утрам правильно\r\nСуществует несложные правила, по которым утренние пробежки смогут легко начать даже те, кто никогда не бегал.\r\n\r\n•Завтракайте либо за 40-60 минут до пробежки, либо после нее. Второй вариант существенно экономит время.\r\n•Если завтракаете позже, после пробуждения выпейте стакан воды. На 30-60 минут бега этого вполне достаточно.\r\n•Используйте специализированные кроссовки для бега, чтобы минимизировать риск повреждения ступней, коленей, позвоночника. Одежда может быть любой, лишь бы не стесняла движения.\r\n•Не пренебрегайте разминкой. После сна обязательно нужно разогнать кровообращение, прогреть суставы прежде чем включать мышцы в работу.\r\n•Не стесняйтесь чередовать бег и ходьбу, если вам не хватает сил и дыхания бежать все тренировку.\r\n•Следите за пульсом, тренируйтесь в зонах разминки, жиросжигания, аэробной нагрузки.\r\n•Бегать по утрам стоит через день по 30–40 минут.\r\n\r\nМожно использовать беговые приложения в смартфоне для контроля расстояния, скорости и пульса — для последнего нужен еще датчик или фитнес-браслет. Смартфон хорош еще и тем, что с ним удобно в процессе тренировки слушать музыку. Только сдвиньте один наушник, чтобы слышать, что происходит вокруг вас.\r\n\r\nРазминка\r\nЕе делают не только новички, но и опытные бегуны. Ночь вы провели лежа и почти неподвижно, поэтому необходимо ускорить кровообращение. «Потратьте 5 минут до начала пробежки на быструю ходьбу или совсем легкий бег, — советует Дмитрий Лапкин. — Затем 5 минут суставной гимнастики: сгибания рук и ног, наклоны, прогибы, приседания, махи руками и ногами, простые танцевальные движения. Никаких рывков и отягощений!»\r\n\r\nКогда кровь начинает активнее циркулировать в мышцах и связках, они разогреваются, что повышает эластичность мышц и соединительных тканей. Это позволяет избежать растяжений и разрывов во время тренировки. Также разогретые мышцы медленнее устают и эффективнее расходуют жир во время тренировки. «Без подготовки сердцу трудно выдержать повышение пульса и резкий приток крови, — напоминает наш эксперт. — А после разминки ваш пламенный мотор готов перекачивать много крови в течение долгого времени и тем самым делает возможным сжигание максимального количества жиров».\r\n\r\nПланирование тренировки\r\nПосле разминки переходите к основной части занятия. Здесь может быть несколько вариантов:\r\n\r\n1. Для совсем новичков: чередовать 2 минуты бегом и 1-2 минуты шагом. Так 20-30 минут. Постепенно сокращайте и убирайте интервалы ходьбы. Когда ходьбы вообще не останется, наращивайте время бега.\r\n2. Для новичков с нормальной физической подготовкой: 20-40 минут равномерного бега с нагрузкой средней интенсивности.\r\n\r\n•Для подготовленных: равномерный бег 30-40 минут по пересеченной местности (с подъемами и спусками) или с ускорениями на 1-2 минуты 3-5 раз за пробежку.\r\n\r\n«Бег — естественный для человека вид передвижения, — напоминает Дмитрий Лапкин, — Тем не менее, людям, которые ранее вели сидячий образ жизни, поначалу следует следить за тем, как они приземляются на стопу, ка работает колено, каково положение корпуса. Общее правило — никогда не приземляйтесь на прямую ногу! Колено всегда должно быть чуть согнуто, так мышцы ног смогут выполнить свои природные функции амортизаторов. Выпрямить колено можно только после отталкивания от земли, когда нога поднимается в воздух».\r\n\r\nТехника бега\r\n•Выдыхайте ртом и носом, вдыхайте ртом. Потребность в кислороде во время бега возрастает, и нос просто не сможет быстро вдохнуть необходимое количество воздуха.\r\n•Cкороcть должнa быть тaкой, чтобы вы могли сказать фразу из 5-6 слов. Если пользуетесь пульсометром, то это 1-2-3 зоны пульса из 5, или первые 2 из 3 (смотря сколько их в вашем устройстве).\r\n•Руки согнуты в локтях, пальцы слегка согнуты, не но сжаты. Работайте ими на уровне нижних ребер, задавая темп. Руки немного напрягаются при выносе вперед и расслабляются при отведении назад.\r\n•Не опускайте подбородок и не сутультесь. Следите за тем, чтобы плечи были развернуты, но не подняты. При беге в подъем слегка наклоняйте корпус вперед, на спусках не откидывайтесь назад.\r\n•Делай беговой шаг, приземляйтесь на среднюю часть стопы или на пятку и перекатывайтесь на носок. Способ приземления должен отвечать критерию «удобный», и не нужно слушать никакие рассуждения на тему «только со стопы» и пр. Это естественный процесс, не надо пытаться приземляться неудобным для вас образом. Колено при касании земли обязательно чуть согнуто, как сказал наш эксперт выше. Чем быстрее вы будете бежать, тем ближе к пальцам вы будете опускать стопу.\r\n•Если вы склонны разворачивать носки наружу (гиперпронация), постарайтесь ставить их более параллельно. Гиперпронация тормозит бег и приводит к перегрузке стопы, а затем и травмам ее и надкостницы. Стоит приобрести беговые кроссовки с контролем пронации, такие модели есть у всех ведущих производителей.\r\nПолезно ли бегать по утрам\r\nКонечно, полезно! Бег — это шанс сжечь жир и укрепить мышцы. Он повышает выносливость и укрепляет сердце, восстанавливает тонус сосудов. Благодаря бегу нормализуется состав крови, растет уровень гемоглобина и содержание кислорода в крови (сатурация). Приходит в норму давление, повышается чувствительность клеток к глюкозе и инсулину.\r\n\r\n«Регулярные пробежки предотвращают сердечно-сосудистые заболевания, сахарный диабет, укрепляют иммунитет и опорно-двигательный аппарат, — подводит итог Дмитрий Лапкин. — Главное — не перегружать организм, втягиваться в тренинг постепенно».\r\n\r\nЧастые вопросы про утренний бег\r\nМожно ли бегать каждый день по утрам?\r\nКому следует воздержаться от утренних пробежек?\r\nПомогает ли утренний бег снизить вес?\r\nМожно, если вы успеваете восстановиться, и каждое утро бодры и полны энергии. Но начинать все-таки лучше с пробежек через день. Постепенно вы придете к тому, что можете совершать их каждый день либо с одни днем отдыха в неделю.\r\n\r\nМы уже упомянули, что если ваш образ жизни или график работы не позволяет вставать раньше, чтобы выйти пробежаться, перенесите занятие на другое время. Во всем остальном если вам не запрещено бегать по медицинским показаниям, можете делать это с утра.\r\n\r\nРазумеется, помогает, как и любой фитнес — при условии, что вы съедаете меньше калорий, чем расходуете на бег. Впрочем, это весьма интенсивный вид спорта, так что потратить 200-300 ккал за полчаса будет несложно. Если следить за питанием, то первый килограмм может уйти уже через 5-7 дней.\r\n\r\nБегайте регулярно и без экстрима, и результат будет вас только радовать.	1	t
11	Тренировка дня: отличный старт для абсолютных новичков	2023-05-28 09:00:00	Сложные тренировки убивают мотивацию: вы не можете сделать и половины и чувствуете себя ужасно. Этот комплекс на 30 минут разогреет вас, поможет вспомнить, как работают мышцы, увеличит мобильность и улучшит осанку.\r\nТренировка состоит из трёх частей:\r\nРазминка и работа над мобильностью.\r\nСиловые упражнения на основные группы мышц.\r\nДвижения, прокачивающие выносливость.\r\nВы можете повторять эту тренировку 2–3 недели, пока не подготовите тело к более сложным упражнениям.\r\nКак сделать разминку\r\nВыполните два круга следующих упражнений (2 минуты работы):\r\nБег на месте — 30 секунд.\r\nПоочерёдный подъём коленей — 30 секунд.\r\nДелайте со средней интенсивностью — это всего лишь разминка, и вам нужно просто разогреться, а не устать.\r\nПосле этого переходите к упражнениям на мобильность.\r\nКак работать над мобильностью\r\nВыполните два круга следующих движений:\r\nПриседания с руками над головой — 40 секунд.\r\nРазминка спины на четвереньках — по 30 секунд в каждую сторону.\r\nШраги в позе кобры — 30 секунд.\r\nРазгибание в «бабочке» — 30 секунд.\r\nПриседания с руками над головой\r\nОпускайтесь настолько глубоко, насколько получается сохранить спину прямой, а пятки — прижатыми к полу.\r\nРазминка спины на четвереньках\r\nСтарайтесь скручивать тело как можно сильнее, но при этом не сгибать опорную руку.\r\nШраги в позе кобры\r\nПоднимайте и опускайте лопатки, прогнувшись в спине. Если хотите усложнить упражнение, оторвите колени и бёдра от пола.\r\nРазгибание в «бабочке»\r\nПрогибайтесь в спине, одновременно стараясь достать коленями до пола.\r\nКак выполнять силовую часть\r\nСиловой блок состоит из трёх элементов:\r\nОтжимания.\r\nНаклонные подтягивания или тяга лёжа на животе.\r\nВыпады или приседания.\r\nВсе движения делайте в три подхода по 6–10 повторений, отдыхайте между подходами по 2 минуты.\r\nОтжимания\r\nЕсли у вас не получается сделать хотя бы шесть повторений с хорошей формой, выполняйте упражнение с колен или от опоры. В последнем варианте можно легко менять уровень сложности, выбирая разную высоту опоры.\r\nНаклонные подтягивания\r\nВы можете выполнять это упражнение на упорах, низком турнике, кольцах или петлях, а также просто на двух стульях.\r\nЕсли вы используете палку, положенную на два сиденья, диапазон движений будет ограничен: руки не смогут полностью разгибаться в нижней точке упражнения. Не переживайте, ваше тело всё равно получит хорошую нагрузку.\r\nЕсли вы не можете выполнять такие подтягивания, замените их тягой лёжа на животе. Это упражнение не нагрузит бицепсы, зато поможет почувствовать мышцы спины.\r\nВы можете выполнять его без веса или взять какое‑то утяжеление вроде лёгких гантелей или бутылок с водой.\r\nПриседания/выпады\r\nЭти движения могут быть слишком простыми даже для новичков, так что не стесняйтесь добавлять вес. Возьмите гантели, тяжёлый рюкзак или канистру с водой и приседайте с ними.\r\nТакже вы можете использовать вариант на одной ноге — «пистолетики» — с опорой на стул или что‑то другое, болгарский сплит‑присед на одной ноге.\r\nЕсли выбираете такие движения, выполняйте по 6–10 повторений на каждую конечность и отдыхайте между сменой сторон по 1 минуте.\r\nКак делать часть на выносливость\r\nЭтот этап выполняется в формате интенсивной интервальной тренировки. Вы работаете в течение 30 секунд без остановки, затем отдыхаете до конца минуты и начинаете заново. Всего нужно сделать четыре таких круга, что займёт 4 минуты.\r\nМожете выбрать из двух упражнений: Jumping Jacks или бег с высоким подниманием бедра. Первый вариант проще, так что, если вы абсолютный новичок, выбирайте его.\r\nВ отличие от разминки, здесь важно поработать действительно интенсивно: все 30 секунд делайте это изо всех сил и старайтесь не снижать темп.	1	t
9	Чем заменить сахар без вреда для здоровья?	2023-05-28 16:00:00	1. Аллюлоза. Содержит 0,4 ккал на 1 г продукта, снижает уровень глюкозы в крови после еды, улучшает чувствительность к инсулину, способствует потере жира и обладает свойствами антиоксиданта.\r\n2. Стевия. Производится из одноимённого растения родом из Южной Америки и имеет в 200–300 раз более сладкий, чем у сахара, вкус. Стевия не влияет на метаболизм, кровяное давление и реакцию на глюкозу в крови, не токсична и не вызывает аллергии.\r\n3. Эритритол, эритрит. Относится к сахарным спиртам. Этот натуральный подсластитель примерно на 20–40% менее сладкий, чем столовый сахар. Около 90% эритрита не усваивается в организме и выходит с мочой, а потому не влияет на уровень глюкозы и инсулина. Кроме того, эта добавка не вредит зубам, может работать как антиоксидант и благотворно сказываться на состоянии сосудов.\r\nКсилит. Ещё один сахарный спирт, который используется в качестве подсластителя. Он считается полезным для здоровья зубов, практически не усваивается в организме и может даже снижать уровень сахара в крови.\r\n4. Сукралоза. Изготавливается из сахара, но имеет в 600 раз более сладкий вкус. Сукралозу признали безопасной для любых групп населения, включая людей с хроническими заболеваниями, такими как диабет.\r\n5. Луо хан гуо. Подсластитель производится из плодов лианы архата и имеет в 10–250 раз более сладкий вкус, чем у сахара. Исследования на животных и тканях в пробирке показали, что экстракт луо хан гуо может работать как антиоксидант, оказывать противовоспалительный эффект, бороться с опухолями, регулировать уровень сахара в крови после еды и поддерживать здоровье нервных клеток.	1	t
10	Мотивация и её сохранение	2023-05-28 22:00:00	        Первоначальная мотивация – дело хорошее. Хочется свернуть горы и достичь невероятного. Тренировки начаты, энергия есть, всё идёт хорошо, но со временем мотивация начинает угасать.\r\nЧтобы оставаться мотивированным, стоит тренироваться с хорошими эмоциями, относясь к тренировке как к пути здоровья, а не нудному и трудному занятию. Подобный подход избавляет от плохих мыслей и желания прекратить занятия.\r\n\r\n        Оплатив услуги тренера, записавшись в секцию, купив абонемент в спортзал, найдя единомышленников будет проще сохранять мотивацию, так как она подкрепляется за счёт материального, а не просто желания тренироваться.\r\n\r\n        Отличным решением будет вести дневник тренировок. Можно купить готовый или просто вести в тетради или блокноте. Записывая вес, программу тренировок и питание, можно будет отследить результат. Когда видно, что прогресс есть, уже тяжело остановиться.\r\n\r\n        К концу статьи важно отметить, что пусть генетика и подобные факторы влияют, они не оказывают ключевую роль. Заниматься спортом, тренироваться и быть здоровым может абсолютно каждый. Для этого не нужно много денег, заниматься можно даже дома. Всё, что нужно для тренировок – сила воли и желание.	1	t
