35	Нисуаз	2023-05-03 00:00:00+03	30	1. Помыть все овощи и зелень, высушить. Сделать заправку для салата заранее, чтобы она хорошо настоялась. Смешать оливковое масло с уксусом. Раздавить дольку чеснока, мелко нарезать листики базилика. Добавить к маслу, посолить, поперчить. Готовую заправку убрать в сторону.\r\n2. В кипящей подсоленной воде отварить фасоль — примерно пять минут. Откинуть фасоль на дуршлаг и окатить ее ледяной водой. Так фасоль сохранит свой красивый зеленый цвет и останется хрустящей.\r\n3. Отрезать у фасоли хвостики. Нагреть 2 столовые ложки оливкового масла, добавить туда раздавленную дольку чеснока. Сразу же выложить фасоль на сковороду и жарить примерно две-три минуты. Пока фасоль жарится, очень мелко нарезать петрушку. Посыпать готовую фасоль петрушкой и сбрызнуть лимонным соком.\r\n4. Аккуратно перемешать и отставить остужаться. Взять две тарелки, на дно каждой выложить рукколу (или порванный салат), сверху — лук, нарезанный полукольцами, затем помидоры и наконец фасоль. На фасоль выложить четвертинку сладкого перца, нарезанного вдоль тонкими полосками. Поверх перца выложить помидоры.\r\n5. Все аккуратно перемешать вилкой, полить заправкой, снова перемешать аккуратно и хорошо. Посолить и поперчить, если нужно. Перед подачей разрезать яйцо на 4 дольки, выложить сверху на салат. Выложить оливки, маслины и анчоусы (по 4 штуки каждому). Сбрызнуть лимонным соком и подавать.	1	\\	t
