38	Суп вишисуаз	2023-05-04 00:00:00+03	40	1. Разогреть масло в глубокой кастрюле, добавить мелко нарубленный репчатый лук и обжарить до мягкости.\r\n2. Добавить мелко нарубленный лук-порей и обжаривать до мягкости теперь уже порея. После чего очищенный картофель, нарезанный мелкими кубиками, и воду. Довести до кипения, посолить, поперчить и варить на медленном огне полчаса.\r\n3. Готовый суп взбить в блендере вместе с холодными сливками до нежного пюреобразного состояния. Для пущей нежности можно протереть суп через мелкое сито. Охладить и подавать, посыпав мелко нарубленным зеленым луком. Во французской традиции вишисуаз часто подают с салатом из слегка обжаренных с чесноком креветок и мелко нарубленного фенхеля, смешанного с лимонным соком и оливковым маслом.\r\n4. Еще один вариант гарнира — нарубленные мелкими кубиками огурцы с зеленым луком и сметаной. Огурцы для такого салата лучше предварительно очистить от кожицы, чтобы их нежная, беззащитная текстура сливалась с кремовой текстурой супа.	1	\\	t
